import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <div className='menu'>
        <ul>
          <li>
            <Link to='/'>TRANG CHỦ</Link>
          </li>
          <li>
            <Link to='/gio-hang'>GIỎ HÀNG</Link>
          </li>
          <li>
            <Link to='/admin'>ADMIN</Link>
          </li>
        </ul>
      </div>
    </Router>
  );
};

export default App;
